import React, {Fragment} from 'react'
import {NavLink} from 'react-router-dom'

export const Navbar = () => {
    return (
        <nav style={{width:'20%'}}>
            <div className="nav flex-column nav-pills" id="v-pills-tab" role="tablist" aria-orientation="vertical">
            <NavLink className="nav-link active" id="v-pills-home-tab" data-toggle="pill" to="/" role="tab" aria-controls="v-pills-home" aria-selected="true">Home</NavLink>
            <NavLink className="nav-link" id="v-pills-profile-tab" data-toggle="pill" to="/about" role="tab" aria-controls="v-pills-profile" aria-selected="false">Profile</NavLink>

            </div>
        </nav>
    )
}
